import React, {Component} from 'react';
import Navbar from '../Navbar/Navbar';

class Contact extends Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Contact">
        <Navbar />
        <h1>Contact me</h1>
      </div>
    );
  }

}

export default Contact;
